App.factory('Modal', function($modal) {

	return {
		forge: function(tmplUrl, ctrl) {

			var modalOps = {};
			modalOps.templateUrl = tmplUrl;
			modalOps.controller = ctrl;

			return function($scope, size, resolve) {
				modalOps.$scope = $scope;
				if (!_.isUndefined(size)) modalOps.size = size;
				if (!_.isUndefined(resolve)) modalOps.resolve = resolve;
				var modalInstance = $modal.open(modalOps);
			}
		},
		modal: function() {
			return $modal;
		}
	};
});
App.factory('Switcher', function(storage) {

	return {
		usePassword: function(wall_code) {
			var result = Number(wall_code.charAt(0));
			return (result === 1) ? true: false;
		},
		checkStorage: function(wall_code) {
			var p = storage.get(wall_code);
			if (_.isNull(p)) return p;
			if (p.expire < new Date().getTime()) {
				storage.remove(wall_code);
				return null;
			}
			return p.password;
		},
		setStorage: function(wall_code, password, auto) {
			var time = new Date().getTime() + (60 * 60);
			if (auto) time = time + (60 * 60 * 24 * 365);
			return storage.set(wall_code, {
				password: password,
				expire: time,
			});
		}
	};
});
App.factory('Latest', function(storage) {

	var key = 'latest';

	return {
		check: function() {
			var cards = storage.get(key);
			if (_.isNull(cards)) cards = [];
			storage.set(key, cards);
			return cards;
		},
		get: function() {
			this.check();
			return storage.get(key);
		},
		push: function(data) {
			this.check();
			if (_.isUndefined(data)) return this.get();
			var cards = this.get();

			var sortedCards = _.reject(cards, function(card) {
				return card.wall_code === data.wall_code;
			});

			sortedCards.unshift({
				title: data.title,
				wall_code: data.wall_code
			});

			if (Number(sortedCards.length) > 12) sortedCards.pop();

			storage.set(key, sortedCards);
			return this.get();
		}
	};
});
App.controller('appCtrl', function($scope, $http, $location, Wall, storage, $modal, $log) {

	$scope.wall = {};
	$scope.card = {};
	$scope.latestCards = [];
	$scope.alerts = [];

	$scope.alertSet = function(click) {
    	storage.set('alert', {click: click, date: new Date().getTime()});
	};

	$scope.createAlert = function(type, msg) {
		return {type: type, msg: msg};
	};

	$scope.addAlert = function(alertObj) {
    	$scope.alerts.push(alertObj);
	};

	$scope.closeAlert = function(index) {
    	$scope.alerts.splice(index, 1);
    	$scope.alertSet(true);
	};

	$scope.closeAllAlert = function() {
    	$scope.alerts = [];
	};

});
App.controller('passwordCtrl', function($scope, $routeParams, Wall, Switcher, Url) {

	$scope.wall = {
		wall_code: $routeParams.code,
		password: '',
		auto: true,
		error: false
	};

	$scope.setWallError = function(bool) {
		$scope.wall.error = bool;
	};

	$scope.checkPassword = function($event) {

		$scope.setWallError(false);

		var w = $scope.wall;
		Wall.checkPassword(w.wall_code, w.password)
		.success(function(res) {
			var result = Switcher.setStorage(w.wall_code, res.data.password, w.auto);
			if (Boolean(result)) return Url.app(w.wall_code).replace();
			return $scope.setWallError(true);
		})
		.error(function() {
			$scope.setWallError(true);
		});
	};

});
